import React from "react";
import { AppBar, Toolbar, Typography, Box } from "@mui/material";
// import MenuIcon from '@mui/icons-material/Menu';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';

class TopBar extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            name: props.name,
        }
    }

    render() {
        return (
            <Box sx={{ flexGrow: 1 }}>
                <AppBar className="cs142-topbar-appBar" position="absolute" style={{background: "#001f3f"}}>
                <IconButton
                size="large"
                edge="start"
                color="inherit"
                aria-label="menu"
                sx={{ mr: 2 }}
                >
                <MenuIcon />
                </IconButton>                
                <Toolbar>
                <Typography variant="h5" color="inherit">
                    Ashton Xiong
                    <br />
                </Typography>
                </Toolbar>
            </AppBar>
          </Box>
        )
    }
}

export default TopBar;
